\begin{document}

\maketitle

\section*{Abstract}
This study examines the effect of blue light on cognitive function. Our longitudinal analysis shows no noticeable effect.

\section{Introduction}
The Effect of Blue Light on Cognitive Function has become increasingly relevant in modern society. We review existing literature and propose a novel approach.

\section{Methodology}
We conducted a longitudinal analysis with 94 participants over 2 months.

\section{Results}
Our analysis revealed significant improvement (p &lt; 0.03).

\section{Conclusion}
These findings suggest important implications for future research and practical applications.

\section{References}
1. Smith et al. (2020)
